define({"topics" : [{"title":"Summary tab","shortdesc":"\n                  <p class=\"shortdesc\">The test result <span class=\"ph uicontrol\">Summary</span> tab reports basic test run information     which summarizes various aspects of the test. A summary report represents the\n                     results of a     single run of one test module.\n                  </p>\n               ","id":"Test_result_summaries","href":"TA_Help\/Topics\/Test_result_summaries.html","menu": {"hasChildren":false,},"tocID":"Test_result_summaries-d46e27100","topics":[]},{"title":"Result Details tab","shortdesc":"\n                  <p class=\"shortdesc\">The <span class=\"ph uicontrol\">Result Details</span> tab displays a detailed (line-by-line) log of     the test execution, which can be essential for test run analysis and debugging.\n                  </p>\n               ","id":"Test_result_details","href":"TA_Help\/Topics\/Test_result_details.html","menu": {"hasChildren":false,},"tocID":"Test_result_details-d46e27114","topics":[]},{"title":"Known Bug Summary tab","shortdesc":"\n                  <p class=\"shortdesc\">Reviewing test results can assist you in determining if and when JIRA bug issues on a     JIRA server should be closed.</p>\n               ","id":"concept_gjh_b5m_tx","href":"TA_Help\/Topics\/ug_results_known_bug_summary.html","menu": {"hasChildren":false,},"tocID":"concept_gjh_b5m_tx-d46e27128","topics":[]},{"title":"Failure\/Error Summary tab","shortdesc":"\n                  <p class=\"shortdesc\">This section displays all failure, error, or warning encountered during the test     run.</p>\n               ","id":"concept_m3h_xtm_tx","href":"TA_Help\/Topics\/ug_results_failure_error_summary.html","menu": {"hasChildren":false,},"tocID":"concept_m3h_xtm_tx-d46e27139","topics":[]},{"title":"Log Information tab","shortdesc":"\n                  <p class=\"shortdesc\"></p>\n               ","id":"concept_hhv_c5m_tx","href":"TA_Help\/Topics\/ug_results_log_information.html","menu": {"hasChildren":false,},"tocID":"concept_hhv_c5m_tx-d46e27150","topics":[]},{"title":"Information tab","shortdesc":"\n                  <p class=\"shortdesc\">The test result <span class=\"ph uicontrol\">Information</span> tab displays general information     about the test, including the date, time and duration of the test run, the type of machine\n                     or     device running the test, the AUT version, etc. The numbers of test cases flagged as       <span class=\"keyword option\">Passed</span>, <span class=\"keyword option\">Failed</span>, <span class=\"keyword option\">Warning</span>,       <span class=\"keyword option\">Error</span>, and <span class=\"keyword option\">Ignored Fails</span> are also displayed.\n                  </p>\n               ","id":"Test_result_information","href":"TA_Help\/Topics\/Test_result_information.html","menu": {"hasChildren":false,},"tocID":"Test_result_information-d46e27160","topics":[]},{"title":"Test result status","shortdesc":"\n                  <p class=\"shortdesc\">The topic of this section contains information about detailed test result         status.</p>\n               ","id":"concept_cdg_yq1_ybb","href":"TA_Help\/Topics\/ug_test_results_status.html","menu": {"hasChildren":false,},"tocID":"concept_cdg_yq1_ybb-d46e27190","topics":[]}]});